List<String> getValidTargetFormats(String sourceFormat) {
  final info = conversionMapping[sourceFormat.toUpperCase()];
  if (info == null) return [];
  final canConvertTo = info['canConvertTo'];
  if (canConvertTo is List) {
    return List<String>.from(canConvertTo);
  }
  return [];
}

bool isValidConversion(String sourceFormat, String targetFormat) {
  return getValidTargetFormats(sourceFormat).contains(targetFormat);
}
